import {Navlink, Link} from "react-router-dom";

class Header extends React.Component{
    render(){
        return(
            <><br /><div className="center">
                <a href="./pages/Home.js"><img src="/files/sushibarlogo.png" alt="Company logo" className="imageresponsive" /></a>
            </div><br /><nav>
                    <ul id="homenav">
                        <li className="homenavbar"> <Navlink to="./pages/Meny.js">MENY</Navlink></li>
                        <li className="homenavbar"> <Navlink to="./pages/HittaHit.js">HITTA&nbsp;HIT</Navlink></li>
                        <li className="homenavbar"> <Navlink to="./pages/Oppettider.js">ÖPPETTIDER</Navlink></li>
                        <li className="homenavbar"> <Navlink to="./pages/Bestall.js">BESTÄLL&nbsp;ONLINE</Navlink></li>
                    </ul>
                </nav><br /><br /></>
        )
    }
}

export default Header;
